import s from './PlannedNewsItem.module.css';

const PlannedNewsItem = () => {
	return (
		<div className={s.planned_item}>
			<div className={s.title}>
				<p>Заголовок новини довжиною макс...</p>
			</div>
		</div>
	);
};

export default PlannedNewsItem;
